import { useState } from "react";
import "../styles/customer-service.scss"

const CustomerService = () => {
    const [clicked, setClicked] = useState()

    function handleClick(i){
        setClicked(i)
    }

    return ( 
        <div>
            <h1>Contattaci per saperne di pi√π</h1>
            <div className="contact-section vh-100 d-flex justify-content-center align-items-center position-relative">

                <div onClick={() => handleClick(0)} className="contact-us bg-secondary z-0">
                    <h2>Chiedi informazioni tramite il modulo seguente</h2>
                    <button id="bg-color-video" className="button-about btn btn-primary fw-bold text-white">Send</button>
                </div>

                <div onClick={() => handleClick(1)} className="reference bg-primary z-0">
                    <h2>Contattaci</h2>
                    <ul>
                        <li>Telefono:</li>
                        <li>Email:</li>
                        <li>Instagram:</li>
                        <li>Facebook:</li>
                        <li>TikTok:</li>
                    </ul>
                </div>

            </div>
        </div>
     );
}
 
export default CustomerService;
